// index.js
import { createRoot } from 'react-dom/client';
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css'
import HeardeAdmin from './Admin/HeardeAdmin'; // Đổi tên thành AdminComponent

const root = createRoot(document.getElementById('root'));


const AppContainer = () => {
  const [userRole, setUserRole] = React.useState('');

  const handleLogin = (role) => {
    setUserRole(role);
  };

  return (
    <React.StrictMode>
      <App onLogin={handleLogin} userRole={userRole} />
      {userRole === 'ADMIN' && <HeardeAdmin />} {/* Sử dụng tên mới của component */}
    </React.StrictMode>
  );
};

root.render(<AppContainer />);
